Описание:
Продается земельный участок. Категория земли: земли населения. Виды разрешённого использования: под нежилыми зданиями , и территории необходимые для использования ( производственных баз). На территории находится 7 объектов: 
- здание техническая мастерская и гараж;
- склад - гараж;
- здание катальная ;
- административное здание;
- склад и гараж. Трансформатор мощностью 50 кВа. Отличная транспортная развязка для любой сферы деятельности. Все объекты оформлены. Все в собственности., 6 фото
